import {BrowserRouter, Routes, Route} from 'react-router-dom'
import DepartamentoList from './components/DepartamentoList'

export default function App () {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<DepartamentoList/>}/>
      </Routes>
    </BrowserRouter>
  )
}
